  - uid: 18731
    components:
    - type: MetaData
      desc: На этой книге есть подпись "Николас Альтер"
      name: дневник
    - type: Transform
      rot: -1.5707963267948966 rad
      pos: 67.41185,-50.283646
      parent: 2
    - type: Paper
      content: >2-
                                Дневник забытого ассистента
                    День 1
          Эвакуационный шаттл улетел вместе со всем экипажем, но я не успел на него. Шаттл совершил скачок в последнюю секунду, когда я бежал к нему. Я не успел остановиться и вылетел в космос, благо космический медипен и стопка проводов с техов меня спасли. Кое как я пришёл в мед блок и подлатался. Теперь моя первостепенная цель - выжить месяц до прибытия инженеров реконструкторов, поскольку ЦК говорило, что будут менять планировку станции. Все поставки карго в этот период не будут работать... Благо станция осталась почти целой и самое важное - библиотека цела! В этот день я вырастил огромное количество урожая и начал размножать коз, теперь мне хватит еды на долгое время. Раздатчики алкоголя и безалкоголя прекрасно работают и жажда мне не страшна! Запас лекарств есть. В мусоросбросе лежал ПДА инженера, теперь я могу взять ресурсы и инструменты! Я обустроил себе маленькую комнатку в библиотеке и начал изучать химию, инженерию и кулинарию. Проверил настройки ДАМа и суперматерии, исходя из инструкции, которую я нашёл в библиотеке, всё настроено исправно, тратить запасы ДАМа я не собираюсь. Взял РИГ атмосферного техника
                    День 2
          Почти весь этот день я экспериментировал с химикатами и изучал учебники по химии. Скукотища, но полезно. Всё равно мне делать нечего весь этот месяц. Говорила мне мама, учись на химика, все дороги будут открыты, а я не послушался и пошёл на подработку... Эхххх...
                    День 3
          Мои эксперементы с химией увенчались успехом! Я смог сделать стимулятор на 2 минуты без негативных эффектов для здоровья и рассудка! Теперь всегда ношу с собой 4 блюспейс мензурки необходимых реагентов для создания дыма. Как же круто бегать с большой скоростью, это точно мне поможет для выживания. Около 3 часов я провёл в библиотеке и уже изучал кулинарию. Питаться батончиками с И.Р.П.'а это конечно полезно, но вообще не вкусно. Благо у меня есть много коз и овощей с фруктами.
                    День 4
          Я научился делать прекрасные блюда. Также я узнал, что в крапивном супе есть несколько унций омнизина, если совместить его с моим стимулятором, то можно будет сильно сэкономить на реагентах и получить тот же результат... Хммм... Нет, даже лучше! Я продолжил изучать кулинарию и в перерывах искал литературу о биохимии.
                    День 5
          Я смог сделать некую полуавтоматическую фабрику омнизина, примерно 98,458 унций в час. Неплохой результат. Я решил, что самое время задуматься о безопасности, поэтому взломал бриг и оружейную и достал оружие с патронами. Пока что патроны я не могу пополнять, поэтому лазерное оружие для меня в приоритете. Принес пару зарядников уже на свою базу. В техах слышны какие то шорохи, гул и шаги. Кажись то объявление "Экипаж, у нас в техах завелась какая то страшная нечесть, не ходите в туда одни и имейте при себе оружие. Было найдено 3 расчлененных трупа в разных местах. Будьте осторожны. Слава НТ!". Тогда я думал, что это шутка, но теперь мне стало страшно... Я укрепил свою базу и в срочном порядке начал изучать инженерию и фантастику с различной нечестью.
                    День 6
          Шаги в техах с каждым часом становились всё громче и быстрее, порой я слышал вдали звуки открытия шлюзов. Но это не так важно, прогуливаясь по станции в коридоре прибытия я заметил длинную черную руку, которая утащила мышку. Это была не просто большая рука, она была очень непропорциональная и абсолютно черная, будто я смотрю в пустоту. Я в спешке убежал от туда и застроил все коридоры и техи ведущие туда. Отныне это место проклято и мне страшно находиться на этом чертовом куске металолома. Весь оставшийся день я искал информацию об этом существе, если это конечно не плод моей поехавшей крыши от одиночества.
                    День 7
          Весь этот день я не слышал никаких посторонних звуков, либо ОНО остановилось, либо это реально плод моей фантазии. Я решил пойти на отчаянный поступок и пошёл исследовать техи, но конечно же не те проклятые. Ничего интересного я там так и не нашёл, однако целый ящик ресурсов был весьма важной находкой для меня. Наконец то я додумался взломать комнаты глав и собрать какие то полезные ресурсы, однако ничего интересного, кроме полного доступа и пачки сигарет я не нашёл. Я изучил почти всю важную для себя литературу.
                    День 8
          Я снова слышу звуки в пролятом блоке, только теперь это крики мышек и безумный смех, но он будто звучит из старого проигрывателя моего деда, который ему достался от его деда, а тому от его деда. Я психанул и поставил кучу решёток под напряжением. Также я начал строить тайный отдел техов, который с космоса легко найти, но изнутри сложно и потихоньку туда переезжать. Весь этот день я потратил на застройку и перенос ресурсов.
                    День 9
          ЕГО нахождение на этой станции меня напрягает. Я должен найти способ убить эту тварь. Я начал разработку химического оружия и додумался вести этот дневник. Думаю я не доживу до 20 дня...
                    День 10
          Прошло 10 дней моих попыток выжить, я смог узнать много нового, обустроить базу, ферму, лабораторию, держать двигатели и атмос в стабильности. Это чудесно. Ебака регулярно даёт о себе знать и иногда повторял "Ничего не стоит риска", "Беги!", "Впусти меня внутрь!", "Прячься прячься прячься прячься прячься прячься прячься прячься прячься". Его речь максимально неестественная. Мне страшно. По гарнитуре РНД услышал, что генератор аномалий был активирован и я вспомнил о технолиях и руководствах по РНД. Оперативно нашёл аномалию, она была плазменной. Быстро стабилизировал её, окружил куполом из стекла и пошёл копить очки, попутно изучая оружие и платы
                    День 11
          Этот день особо ничем не отличился, я изучил все технологии с уничтожил аномалию. Химичиское оружие было завершено. Я проверил все доступные мне помещения, в которых не было замечено ебаки и принес ресурсы на базу.
                    День 12
          Настало время расправы! Я взял свой новенький блюспейс рюкзак и чуть не положил в него другой блюспейс рюкзак... Я слыхал, что это может привести к фатальным последствиям. Проверять сейчас я не хочу. Взял все стимуляторы, лекарства, патроны, оружие, химические гранаты, еду, ресурсы и инструменты. Я проходил мимо карго и увидел через окно отсутствие света в отделе, но это не самое страшное, в самом дальшем уголке стояло ОНО со своей светящийся широкой улыбкой и неестественными светящимеся глазами. Я резко понял, что не готов ко встрече с НИМ и быстро сбежал. Подключил свет в коридорах и на своей базе к генераторам.
                    День 13
          Этот день начался максимально плохо. У меня сильно болела голова, таблетки не помогали. Ко мне на базу забежала странная мышь и легла рядом со мной. Я не придал этому огромного значения, пока не увидел ЕГО за окном своей базы, только тогда я понял, что забыл правильно подкючить генераторы в коридоре. У меня давно так легко не проходила головная боль. Я взял лазер и начал стрелять по НЕМУ, пока ОНО неспеша подходило к моему окну, лучи как будто проходили сквозь НЕГО, однако с каждым выстрелом ЕГО улыбка тускнела и сужалась. Возможно я смог ЕГО ослабить на время. Мышке дал маску, баллон и положил в рюкзак, после чего покинул свою базу через космос. Около часа я думал о своих дальнейших действиях и вспомнил про факсы и красный телефон. При возврате на станцию я быстро починил свет в коридоре и увидел как ОНО быстро пробегало по коридору в свою проклятую часть. Видимо ОНО боится света. Прекрасно!
                    День 14
          Я попал на мостик и начал звать на помощь ЦК. Ответ получил почти сразу и они сначала хотели прислать инженера и офицера ЦК, но после моего факса о ебаке они пообещали прислать ОБР, однако ближайший отряд мог освободиться через 5 дней. Присылать своих людей они не хотели, поэтому дали координаты ближайших станций и самого ЦК с приказом построить шаттл.
                    День 15
          Я начал постройку шаттла около своей базы, пришлось чуток разобрать сервис для ресурсов. Переодически слышал ЕГО фразы и смех. Я уже почти привык...
                    День 16
          Постройка шаттла была заморожена, мне не хватает ресурсов для генератора. Забирать генераторы с базы и коридора я как то не хотел. Поэтому я думал проникнуть в карго, но ОНО было там. Я продолжил постройку каркаса и вспомнил про мышку. Пришёл на базу, вытащил её. Такое ощущение, будто она пыталась меня обматерить, но всё равно была благодарна за спасение. Я откормил и отпоил её, а также подлечил. Теперь она мой питомец и мы пытаемся общаться, она меня понимает, что очень приятно.
                    День 17
          Постройка шаттла разморожена, я вспомнил про ДАМ и зажатое топливо для лучшего момента, кажись этот момент настал. Первый вылет шаттла оказался успешным, однако я не умею им управлять и ввод координат заблокирован.
                    День 18
          Я искал инструкции по управлению шаттлом в библиотеке весь день, но так и не нашёл. Решил снова поиграться с химикатами.
        По гарнитуре РНД снова услышал активацию генератора аномалий, но мне было всё равно...
                    День 19
          Остался 1 день до прилета ОБР. Я снова пришёл в библиотеку, не знаю на что я надеялся, но нужную книгу я всё же нашёл под диваном. Проходя мимо РНД я заметил, что весь отдел был в горящей плазме. Как оказалось это проплавился тот самый купол, ведь прямо в нём появилась новая аномалия. Как иронично... Благо аккуратное создание разгермы убрало риск моего запекания в собственном соку.
                    День 20
          В этот день я снова прислал факс на ЦК и вызов ОБР был одобрен. Также я спросил как активировать координаты, но на это не получил внятного ответа, кажись они сами не знали причины неполадки... Я с мышкой сели на шаттл и начали облетать станцию в ожидании ОБР. Он прилетел и мы вместе пристыковались на моей базе. Я показал ему местонахождение ебаки, а меня самого и мышку оставили на шаттле ОБР в ожидании. Там была рация. Спустя пол часа я начал слышать по рации крики, безумный искаженный смех, выстрелы и последний очень громкий ЕГО крик. В этот момент я был рад как никогда. ОБР вернулся на шаттл и наконец то мои страдания окончились!
